import Button from '@mui/material/Button'
import { useNavigate } from 'react-router-dom'
import StyledButton from '../atoms/styledButton'

import ChoosePayedByButton from '../molecules/choosePayedByButton'
import EditDeleteButton from '../molecules/editDeleteButton'
import CrudUnit from '../organisms/crudUnit'

import { useRecoilValue, useRecoilState } from 'recoil'
import { paymentState } from '../../recoil/atoms'
import { TableContainer } from '@mui/material'

import {
    Table,
    TableHead, 
    TableBody, 
    TableRow, 
    TableCell,
} from '@mui/material'
import { Paper } from '@mui/material'


function HomeEffectPage() {
    const navigate = useNavigate()
    const buttonon = () => {
        navigate("/main")
    }

    const [payments, setPayments] = useRecoilState(paymentState)

    return(
        <>
            <h1>かっこいいエフェクト</h1>
            <Button onClick={buttonon}>始める</Button>
            <StyledButton value={"スタイルドボタン"} style={{width: "100%"}}/>

            {payments.map((payment)=>(
                <ChoosePayedByButton
                    key={payment.id}
                    payment={payment}
                />
            ))   
            }

            {payments.map((payment)=>(
                <EditDeleteButton
                    key={payment.id}
                    payment={payment}
                />
            ))   
            }


            <TableContainer component={Paper}>
                <Table>
                    <TableHead>
                        <TableCell></TableCell>
                        <TableCell>金額</TableCell>
                        <TableCell>名前</TableCell>
                        <TableCell>用途</TableCell>
                        <TableCell>支払い方法</TableCell>
                        <TableCell>支払日</TableCell>
                        <TableCell></TableCell>
                    </TableHead>
                    <TableBody>
                        {payments.map((payment) => (
                            <CrudUnit
                                key={payment.id+"unit"}
                                payment={payment}
                            />
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>



        </>
    )
}

export default HomeEffectPage
